INSERT INTO CarWash.NEWS (ID, CONTENT, DATE, DECRIPTION, TITLE, PICTURE_ID) VALUES (1, 'Баттон уже выигрывал эту гонку, а Магнуссена ждёт дебют за рулём Формулы 1 в Монако, но они оба очень хотят понять, чего смогут добиться в этот уик-энд. Гонка в Монако уникальна, порой здесь можно добиться большего, чем на более традиционных трассах, но, как и в известном местном казино, многое зависит от удачи. Мы надеемся, что в этот уик-энд она окажется на нашей стороне!', '2014-05-21 00:00:00.0', 'Три последних гоночных уик-энда получились сложными для нашей команды, но мы делаем всё, чтобы добиться прогресса.', 'Эрик Булье продолжает верить в удачу McLaren', 6);
INSERT INTO CarWash.NEWS (ID, CONTENT, DATE, DECRIPTION, TITLE, PICTURE_ID) VALUES (2, 'Публичная премьера прототипа состоится на фестивале поклонников марки Volkswagen, который пройдет в конце мая рядом с австрийским озером Вёртерзее.', '2014-05-21 00:00:00.0', 'Компания Seat построила концептуальный родстер под названием Cupster в честь 30-летия с момента выпуска модели Ibiza первого поколения.', 'Seat отпразднует 30-летие Ibiza экстравагантным родстером', 7);
INSERT INTO CarWash.NEWS (ID, CONTENT, DATE, DECRIPTION, TITLE) VALUES (3, 'На такие меры ведомство решило пойти с целью сокращения последствий налоговых реформ для нефтяной отрасли. Министр энергетики РФ Александр Новак отправил соответствующие предложения вице-премьеру по ТЭКу Аркадию Дворковичу, сообщают «Известия».', '2014-05-21 00:00:00.0', 'В России цены на бензин могут резко вырасти. Подорожание топлива может произойти из-за новой инициативы Минэнерго, которая предлагает снизить таможенные пошлины и акцизы на бензин.', 'Россияне готовятся к подоражанию бензина');
